INSERT INTO `event_manage` VALUES (2,'192.168.241.171系统宕机','osadmin',0,'随手记事业部','/static/event/1494407549_QQ图片20170510171130.png','普通','17:10分系统挂起不能工作，控制台报错截图如附件。\r\n已重启恢复','已重启恢复','北京铜牛机房','已经解决','2017-05-10 13:53:16'),(3,'convirt 配置写错导致镜像被删除','osadmin',1,'平台','/static/event/1494408433_vm.jpg','高','铜牛机房迁移运维发版api虚拟机到马驹桥机房，镜像复制到马驹桥机房后 顺手把铜牛机房的镜像删除了，然后在马驹桥convirt平台填写新建虚拟机的时候长久没弄配置写错 把配置文件写成了镜像地址导致镜像变成配置文件。','机器没了 只能重新配置环境，手残了一下  以后迁移虚拟机确保可以启动 迁移完成在去删除以前的镜像','北京马驹桥机房','已经解决','2017-05-10 13:53:16'),(4,'内网部分IP丢包','wangjunjie',NULL,'铜牛机房',NULL,'高','时间:7月10号 21:00 - 0:30 左右\r\n内网241.28 和 241.97 两个IP出现比较严重的丢包情况\r\n服务器重启之后也没有恢复.\r\n最后于凌晨1点左右恢复.\r\n\r\n时间:7月10号 19:30 开始\r\n内网 15,17,28 这三个IP 出现不同情况的丢包.\r\n后查明问题是hadoop机器在跑业务，大流量跨内网交换机传输。\r\n导致部分IP丢包。\r\n\r\n目前，hadoop服务器仍然会不定期进行大数据计算，到时还是会影响网络状况。\r\n问题尚待解决。','','1','已经解决','2015-07-15 11:14:08'),(5,'数据库升级导致服务器压力过高','wangjunjie',NULL,'铜牛机房',NULL,'高','近期数据库升级，导致数据库服务器负载过高，zabbix监控报警频繁。','','1','已经解决','2015-07-15 15:54:09'),(6,'数据库升级后,tomcat服务器占用cpu过高','wangjunjie',NULL,'铜牛机房',NULL,'高','时间:7月12日 23:00 开始\r\n社区的三台服务器（139,140,141）负载过高，tomcat占用CPU过高，分析过后可能是因为数据库升级后，导致的BUG。','时间：7月14日 17:00左右\r\n目前守财升级了 mysql-connector 版本，现在tomcat负载已经降下来了。\r\n需要持续观察一周左后，看是否稳定。','1','已经解决','2015-07-15 16:02:24'),(7,'Centos103 nfs资源恢复','xusheng',NULL,'铜牛机房',NULL,'普通','时间：2015-07-21  20：30，收到开发同事曾万忠反馈论坛用户的图片不能访问。经过检查发现Centos103nfs服务器的资源图片丢失。大小为45G。','1、找到主机Centos128上面最新的103资源备份。即2015-7-19号。然后拷贝到服务器103对应的资源目录。\r\n2、bbs的论坛服务器采用了集群架构，为了不影响论坛的正常访问。所以将后端的物理机剥离出来集群环境一台一台重新挂载。还原后再加入到集群服务器中。','1','已经解决','2015-07-21 12:20:05'),(8,'Centos154主板故障','xusheng',NULL,'铜牛机房',NULL,'高','时间：2015-7-20 收到故障报警，发现服务器自动重启并卡在故障页面不能开机。登录idrac管理页面发现有cpu异常报警','报修dell工程师，在协助工程师的两次排查后，这次更换主板\r\n更换主板问题没有解决，dell工程师排查问题后，更换了cpu2','1','已经解决','2015-07-23 14:03:52'),(9,'centos40一条内存插槽故障','xusheng',NULL,'铜牛机房',NULL,'高','时间：2015-08-03  Centos40 标配16G内存，登录发现剩余12G','1、首先插拔不识别的内存条\r\n2、从Centos81上面拆出内存插在Centos40上面\r\n3、将40上面内存插到别的内存插槽中去\r\n4、内存插拔顺序 3 6 9 2 5 8 1 4 7  其中 2和3 1和4 是冗余\r\n','1','已经解决','2015-08-04 16:52:09'),(10,'centos154硬件故障','xusheng',NULL,'铜牛机房',NULL,'高','开始时间8-10号。再次出现cpu报错问题。','经过dell的工程师维修已经解决cpu报错问题。\r\n还在解决一个cmos电池的问题','1','已经解决','2015-08-13 13:48:03'),(11,'Centos88内存报错','xusheng',NULL,'铜牛机房',NULL,'高','开始时间提示第三条内存报错','1、通知机房人员把第三条内村重新插\r\n2、如果还有问题请dell工程师去机房更换内存','1','已经解决','2015-08-13 14:30:00'),(12,'exsi_112硬件出现问题','xusheng',NULL,'铜牛机房',NULL,'普通','故障时间：2015-8-13号凌晨;exsi_112硬件故障，导致haproxy系统出现假死状态，没有跳转。','重启exsi_112服务器。自动跳转到高可用。','1','已经解决','2015-08-13 14:36:29'),(13,'卡牛的adsl故障','xusheng',NULL,'铜牛机房',NULL,'高','故障时间：8月12。机房反馈是adsl机房出口线路故障。因为adsl出现问题后本地也可以向外面访问，所以基本没有影响。','联通人员去机房处理。','3','已经解决','2015-08-13 15:12:55'),(14,'卡牛服务器Centos73硬盘故障','xusheng',NULL,'铜牛机房',NULL,'高','故障时间：9月8。zabbix报警centos73第二块硬盘故障。因为做了raid5.所以不影响故障','报修dell工作人员。工作人员已经处理。','3','已经解决','2015-09-09 11:37:25'),(15,'卡牛业务连接日志服务器故障','fangjijun',NULL,'铜牛机房',NULL,'高','9月10日上午9:30，卡牛新业务需要写日志到随手记的192.168.241.89；因日志系统未充分调试，导致跨机房传输数据过大50Mb/sec；造成随手记机房的入口流量有一定程度的拥塞，卡牛机房的出口流量有一定程度拥塞；在业务高峰时会影响用户的访问速度。','目前采用临时解决方案，暂停日志跨公网传输','1','已经解决','2015-09-11 15:54:22'),(16,'金融服务器bj3-4-centos177服务器宕机','xusheng',NULL,'铜牛机房',NULL,'普通','开始时间：9月24日早上6：40分金融服务器bj3-4-centos177宕机。dell诊断内存问题引发cpu报警。造成宕机开不了机。宿主机已做高可用。','更换了内存，收集日志正常后开机继续运行业务','5','已经解决','2015-09-24 14:12:34'),(17,'理财页面不可用   【20150930】','liushoucai',NULL,'铜牛机房',NULL,'普通','手机开启钱包显示gateway 错误，数据库高负载\r\n时间 【20150930 晚上约7:30-8:30】\r\n','找出高负载原因并优化索引修复','1','已经解决','2015-10-08 11:28:44'),(18,'IP地址为：10.198.4.177主机宕机','xusheng',NULL,'铜牛机房',NULL,'普通','开始时间：10月10上午10：40分左右金融服务器IP地址为：10.198.4.177宕机开不了机。过一会后重启进入系统，宿主机已做高可用。错误信息为：CPU 1 has an internal error (IERR)','11号晚上关机断电重启之后，D12内存报错，12号早上更换内存之后。恢复正常。','5','已经解决','2015-10-10 12:38:16'),(19,'192.168.241.92异常宕机','xusheng',NULL,'铜牛机房',NULL,'普通','开始时间：10月15下午18：00左右随手记服务器IP为：192.168.241.92异常宕机且开机无反应。192.168.241.92为money08.feidee.net的后端tomcat应用。已经做了高可用，没有影响线上的生产环境。','','1','已经解决','2015-10-15 20:48:18'),(20,'192.168.241.93电压报错','xusheng',NULL,'铜牛机房',NULL,'高','开始时间：10月15下午18：00左右随手记服务器IP为：192.168.241.93电压报错。业务为：各事业部测试环境环境从库，没有影响系统正常使用。报错信息为：PS2 PG Fail	Bad','','1','已经解决','2015-10-15 20:52:34'),(21,'88同机柜服务器电源故障','wangjunjie',NULL,'铜牛机房',NULL,'高',' 机房人员操作88服务器，误操作导致机柜两台服务器电源故障','','1','已经解决','2015-10-19 15:23:58'),(22,'10.192.1.17内存报错','linqiang',NULL,'铜牛机房',NULL,'高','10.192.1.17首先是cpu报错，后面内存也报错。','更换内存就好了。','1','已经解决','2015-11-02 10:07:05'),(23,'192.168.241.26','linqiang',NULL,'铜牛机房',NULL,'高','192.168.241.26  两个磁盘故障','周三数据库恢复，邮件系统正常运行','1','已经解决','2015-12-15 16:55:36'),(24,'192.168.241.83硬盘损坏','linqiang',NULL,'铜牛机房',NULL,'高','192.168.241.83硬盘有一块硬盘损坏','','1','已经解决','2016-01-25 11:15:37'),(25,'10.192.1.87硬盘损坏（补记录）','linqiang',NULL,'铜牛机房',NULL,'高','2016年1月6号，10.192.1.87硬盘损坏。','换硬盘','3','已经解决','2016-01-25 12:32:50'),(26,'10.195.1.22内存损坏（补记录）','linqiang',NULL,'铜牛机房',NULL,'高','2016年1月11号，10.195.1.22内存B8损坏。','','1','已经解决','2016-01-25 19:01:26'),(27,'192.168.241.133硬盘坏掉','linqiang',NULL,'铜牛机房',NULL,'高','192.168.241.133有个硬盘损坏。','工程师上门换硬盘，报警恢复。','1','已经解决','2016-03-15 11:13:48'),(28,'北京铜牛机房电力故障，随手记，卡牛，金融服务器宕机','linqiang',NULL,'铜牛机房',NULL,'普通','北京铜牛机房电力故障，9:45服务器宕机，主要业务11：25左右恢复','','1','已经解决','2016-04-01 16:26:26'),(29,'DB从库提示CPU报错不能开机','wangtan',NULL,'铜牛机房',NULL,'高','PCI System error at F000:9A0D PCI错误引起CPU报错，不能开机。','Dell工程师上门更换主板。','1','已经解决','2016-04-06 16:43:58'),(30,'理财钱包网页打不开','chenglinjian',NULL,'铜牛机房','/usr/local/tomcat_6.041/upload/2016-04-11/chenglinjian/6092.txt','高','4.10晚上22：30左右，金融同事说有用户反馈公司理财钱包网页打不开，显示网络连接已断开，无法打开网页，已判断是IDC节点问题。','当天晚上故障已处理，王吉平反馈说是他们的程序有些问题。','1','已经解决','2016-04-11 12:52:21'),(31,'北京铜牛机房网络故障','wenzhaojun',NULL,'铜牛机房',NULL,'普通','因施工光缆被挖断，导致2016.4.26凌晨00-02点北京铜牛机房网络故障，2点左右恢复。','','3','已经解决','2016-04-27 09:46:55'),(32,'KD194.1.86硬盘更换','wenzhaojun',NULL,'铜牛机房',NULL,'高','1.192.1.86第二款硬盘损坏，需要更换硬盘','','5','已经解决','2016-04-27 09:50:46'),(33,'kd198.6.163服务器宕机','linqiang',NULL,'铜牛机房',NULL,'普通','kd198.6.163这台服务器发现问题时系统已经关闭，后台管理卡显示只能打开电源，宕机原因不明确，后续观察。','打开系统电源，进一步观察系统运行情况。','5','已经解决','2016-04-30 17:14:31'),(34,'北京机房到广州机房VPN无法到达','wangtan',NULL,'铜牛机房',NULL,'高','北京机房到广州机房VPN无法到达，随手记192.168.241.1（北京）到10.199.2.1（广州）不通。但是广州机房和北京机房公网都是正常的。深圳办公室代理可以拨通到两个机房。','自动恢复。','1','已经解决','2016-05-03 15:46:26'),(35,'192.168.241.201 系统假死','wangjunjie',NULL,'铜牛机房',NULL,'高','192.168.241.201 系统假死\r\n','报错显示为内存溢出\r\n重启后恢复','1','已经解决','2016-05-04 12:54:15'),(36,'2016.5.5 办公网故障','wenzhaojun',NULL,'铜牛机房',NULL,'普通','2016年5月5号 19:00-20:30办公网故障','重启交换机','4','已经解决','2016-05-06 14:08:59'),(37,'192.168.241.129硬盘故障','moguoliang',NULL,'铜牛机房',NULL,'高','192.168.241.129硬盘故障','','1','已经解决','2016-05-18 19:20:32'),(38,'随手记机房网络中断','wangjunjie',NULL,'铜牛机房',NULL,'普通','10：17分开始，随手记机房网络中断，所有随手记业务受影响。\r\n持续一个小时.','网络的同事恢复防火墙后.网络恢复.','1','已经解决','2016-05-20 09:47:04'),(39,'服务器内存条松动','wangjunjie',NULL,'铜牛机房',NULL,'高','10.199.2.105 内存条松动. 随后关机重新插拔之后恢复.','10.199.2.105 内存条松动. 随后关机重新插拔之后恢复.','2','已经解决','2016-05-20 09:49:09'),(40,'社区http偶尔页面样式混乱','wangjunjie',NULL,'铜牛机房',NULL,'高','社区http偶尔页面样式混乱，https没有问题。\r\n期间暂时没有接到用户反馈，APP端是https访问，所以没有影响。','通知开发同事回滚版本','1','已经解决','2016-05-20 09:52:08'),(41,'日志库 192.168.241.132 宕机','linqiang',NULL,'铜牛机房',NULL,'高','192.168.241.132 宕机，内核报错 linux内核panic','重启业务恢复','1','已经解决','2016-12-12 23:42:35'),(42,'192.168.241.42，随手记haproxy一块硬盘坏掉','linqiang',NULL,'铜牛机房',NULL,'高','192.168.241.42，随手记haproxy一块硬盘坏掉','跟换硬盘，问题解决','1','已经解决','2017-01-01 13:00:28'),(43,'192.168.241.49 账族业务一块硬盘坏掉','linqiang',NULL,'铜牛机房',NULL,'高','192.168.241.49 账族业务一块硬盘坏掉','更换硬盘，已经修复','1','已经解决','2017-01-01 13:04:21'),(44,'zabbix server 进程死掉','linqiang',NULL,'铜牛机房','/usr/local/tomcat_6.041/upload/2017-01-05/linqiang/6293.txt','高','zabbix server 进程会死掉','查看日志，是内存溢出问题，在zabbix_server.conf 加大 TrendCacheSize 的内存到2G','1','已经解决','2017-01-06 00:01:57'),(45,'10.198.2.45  redis 服务器宕机','linqiang',NULL,'铜牛机房',NULL,'高','10.198.2.45  redis 服务器宕机，控制台无法看到系统情况，还不能判定原因','','5','已经解决','2017-01-06 13:14:53'),(46,'理财市场无法访问','linqiang',NULL,'铜牛机房',NULL,'高','理财市场无法访问','理财市场流量增高，入口无法访问，后面切换到虚拟机入口恢复，怀疑是haproxy单进程压力过大无法工作，后面使用ab  2000并发，100000请求总和 压测单进程haproxy，发现请求无法访问，确认问题。','5','已经解决','2017-01-16 22