机分别走不同出口和铜牛机房建立vpn隧道。\r\n    3.联通代理机部署。','1','已经解决','2017-04-01 16:30:18'),(58,'铜牛SSJ出口遭受流量攻击','kongyuan',NULL,'铜牛机房',NULL,'高','2017年4月1日，上午11：25--11：40铜牛机房SSJ出口遭受流量攻击，导致SSJ出口下行带宽拥塞，防火墙cpu利用率达到72%，影响用户访问铜牛机房业务。','攻击时间较短，自动恢复。','1','已经解决','2017-04-01 17:21:46'),(59,'信贷业务数据库从库 10.192.1.71 宕机','linqiang',NULL,'铜牛机房','/usr/local/tomcat_6.041/upload/2017-04-09/linqiang/6496.txt','高','信贷业务数据库从库 10.192.1.71 宕机，系统内核有报错','','3','1','2017-04-09 20:01:06'),(60,'随手记分区库(10.255.3.203 10分钟无数据上报)','hufangrui',NULL,'铜牛机房',NULL,'高','故障时间:4月3日23:12\r\n故障解决时间:4月4日8:12\r\n原因:数据库异常,\r\nmoney_15        Killed  38171   closing tables  select FID, FCreditID, FType, FFrequency, FReplay, FTime, FContent, FMessage, FTradingEntity    from t_credit_card_remind        where FTradingEntity = 23456939522 and FCreditID = 0\r\n表无法close','临时解决方法:\r\n该实例出现多次同样故障,临时解决重启实例\r\n具体解决方法:\r\n更换硬件，排除硬件上问题','1','已经解决','2017-04-10 18:33:02'),(61,'10.255.3.202连接数报警(社区的持久化组件连不上数据库)','hufangrui',NULL,'铜牛机房','/usr/local/tomcat_6.041/upload/2017-04-24/hufangrui/6498.txt','高','故障时间: 9:14\r\n相应时间: 9:15\r\n故障解决时间: 10:17\r\n\r\n1、查看慢sql日志文件，4月23号8:00至4月23号10:00期间，无慢速sql。\r\n2、9点30分左右，林强帮忙重启数据库实例\r\n3、9点50分,查看数据没有sql堵塞，连接数不停的创建连接与取消连接。\r\n4、万忠 临时 将数据库连接 设置为短连接\r\n\r\n查看图1\r\nsql执行状态\r\n\r\n查看图2\r\n9点与之前都是正常的量，9点之后直线上涨数据库连接（期间不停的创建连接与取消连接）\r\n\r\n图3绿色线为取消链接数量','临时设置业务使用短连接连接数据库','1','已经解决','2017-04-24 15:56:07'),(62,'随手记登录失败','liuqiao',NULL,'铜牛机房',NULL,'高','1、登录和登录相关数据库服务器宕机，服务器PING不通，接收到报警；\r\n2、远程登录发现系统被挂起，重启机器后发现SSH连接不上，关闭IPTABLES才能连接上；\r\n3、用户无法登录随手记；','1、数据库MHA对两个实例自动做了紧急切换到新的机器；\r\n2、切换后询问开发人员业务是否正常，开发人员反馈还有部分业务不正常；\r\n3、DBA根据反馈定位问题为切换中还有一个实例VIP配置失败，并做了相应处理，故障解除；','1','已经解决','2017-04-24 17:03:02'),(63,'消息系统241.69、241.219从库磁盘95%','hufangrui',NULL,'铜牛机房',NULL,'高','每月11号，会有个任务复制大表，导致磁盘超过95%','会尽快把这2台机器将raid1+raid0 重做为raid5 进行扩容。','1','1','2017-05-11 07:49:35'),(64,'KD255.1.29 硬盘损坏','wenzhaojun',NULL,'铜牛机房',NULL,'高','KD255.1.29 硬盘损坏，已更换硬盘','更换硬盘','3','已经解决','2016-05-25 18:04:04'),(65,'社区部分出现503页面','wangjunjie',NULL,'铜牛机房