9-18 14:00:17'),(78,'10.199.2.18 omsa 无法检测硬件','linqiang',NULL,'铜牛机房',NULL,'高','10.199.2.18 omsa 无法检测硬件','使用ipmitool工具来进行硬件检测','2','已经解决','2016-09-20 10:05:55'),(79,'10.198.2.180 keepalived假死','linqiang',NULL,'铜牛机房',NULL,'高','10.198.2.180 keepalived假死，系统日子报错，Sep 20 19:30:56 bj3-2-centos180 kernel: nf_conntrack: table full, dropping packet\r\n\r\n\r\n','解决：\r\n16G内存机器\r\necho 524288  /proc/sys/net/netfilter/nf_conntrack_max\r\necho 65535（524288/8 ） /proc/sys/net/netfilter/nf_conntrack_buckets','1','已经解决','2016-09-20 20:02:03'),(80,'论坛网站部分地区无法访问','linqiang',NULL,'铜牛机房',NULL,'高','论坛网站部分地区无法访问','论坛网站部分地区无法访问，代码bug，已修复。','1','已经解决','2016-09-21 14:11:59'),(81,'消息拉取后端 10.195.1.140 nginx出现reponse time over 1 second','linqiang',NULL,'铜牛机房',NULL,'普通','消息拉取后端 10.195.1.140 nginx出现reponse time over 1 second','数据库有10来秒不太稳定，出现了超时。','1','已经解决','2016-10-09 14:03:57'),(82,'downloads.feidee.com帝联CDN上传服务器异常','wangjunjie',NULL,'铜牛机房',NULL,'高','CDN的FTP上传域名不能使用,报权限错误,影响用户分享账本功能.','以下是帝联给出的故障报告:\r\n一、故障现象\r\n    部分域名伪源登陆、上传异常，部分用户回伪源取数据的访问存在异常\r\n二、影响范围\r\n    部分需要回源到异常伪源设备取数据的用户的访问\r\n三、根本原因\r\n   一组伪源存储设备所在机房交换机有问题导致机房网络间断性不稳定，影响用户的登陆、上传和回源访问。\r\n四、 处理过程\r\n  9月28日 \r\n22:00我方监控值班人员发现伪源监控网络报警，分析发现一组伪源设备所在机房网络不稳定，立即通知机房同事紧急处理。\r\n  22:49陆续接到客户报障伪源有上传失败的情况，同时有访问慢的现象，排查发现是机房网络不稳定导致，立即通知机房提高优先级紧急处理并持续关注机房网络情况。\r\n  23:50 我司监控发现机房网络间隙有不稳定情况，机房人员尽快紧急排查发现机房核心交换机不稳定导致，暂时通过重启解决；同时通知机房人员尽快更换交换机设备，以确保存储设备的稳定。\r\n9月29日\r\n10:30 机房工作人员更换存储设备核心交换机后，存储设备的登陆和访问逐步恢复正常。 ','1','已经解决','2016-10-10 16:56:10'),(83,'downloads.feidee.com帝联CDN文件丢失','wangjunjie',NULL,'铜牛机房',NULL,'高','故障时间：2016年10月9日  7:30——10月10日15:00\r\n现象：文件上传后被删除， 造成APP部门页面banner无法显示。','CDN服务故障说明\r\n\r\n尊敬的客户：\r\n    您好!\r\n首先，我们为本次CDN服务故障为贵方的业务带来的影响深表歉意！\r\n针对本次故障，我们在此对于问题细节及我方处理措施做以下陈述，如贵方有任何疑问可随时与我们沟通。\r\n一、故障时间\r\n    2016年10月9日  7:30——10月10日15:00\r\n二、故障现象\r\n    金蝶（随手记）下加速域名downloads.feidee.com通过upload-cloud.gls.acadn.com这台FTP服务器上传文件后会被自动删除。\r\n三、影响范围\r\n     用户无法访问更新内容。\r\n四、根本原因\r\n10月9日早晨伪源紧急割接，割接会造成FTP上传、RSYNC同步失败、回源访问失败，由于我方失误未通知到贵方。9号上午其中一台备份进程被异常触发，导致之前某一时刻的内容会更新替代当前内容，致使最新上传的文件被同步丢失。\r\n五、处理过程\r\n（1）10:25我司陆续接到客户访问异常的报障，立即对问题进行排查分析；\r\n（2）10:45因我司割接后个别客户访问异常，对异常问题进行处理。上传文件不成功的原因较为隐蔽，未能及时发现。\r\n（3）14:50次日我司排查发现上传目录为空，经过多次测试发现更新后会被原服务器更新掉，分析日志确认为原伪源服务器有进程异常启用。\r\n（4）14:55  所有机器检查确认完毕，全网访问恢复正常；\r\n六、规避与改进措施\r\n（1）加强平台割接的审核检查以及下发之后的复查，减少此类问题的发生；\r\n（2）提高配置回滚的效率，在出现问题后能更快的恢复；\r\n（3）优化产品，加强程序多维度的测试，加强产品迭代升级的风险控制和容灾方案；\r\n（4）优化故障排查及反馈流程，加强处理过程中与客户的沟通，及时反馈排障进程，确保客户得到合理的反馈，以便及时调用备份方案，降低故障影响；\r\n\r\n     再次为本次故障给贵方业务带来影响致歉，十分感谢贵方对帝联长期以来的支持，我们会尽最大努力不断提高我们的服务质量！\r\n\r\n                              上海帝联信息科技股份有限公司技术服务部\r\n                                           2016年10月12日','1','已经解决','2016-10-13 10:28:36'),(84,'卡牛贷款业务库和流水库的datacenter合并库 10.192.1.90 130G内存不知被什么占用','linqiang',NULL,'铜牛机房',NULL,'高','卡牛贷款业务库和流水库的datacenter合并库 10.192.1.90 130G内存不知被什么占用，也找不到占用的应用程序。','HugePages占用的内存，在/etc/security/limits.conf配置 \r\n*                               soft    nofile  65536\r\n*                               hard    nofile  65536\r\n导致，使用\r\nsysctl -w vm.nr_hugepages=0,生效，并注销上面两行。\r\n','3','已经解决','2016-10-17 09:47:48'),(85,'192.168.241.68负载过高,连不上memcached','wangjunjie',NULL,'铜牛机房',NULL,'高','192.168.241.68 报警负载过高，社区少量登录接口超时.68上的tomcat也有链接不上memcached的现象。\r\n社区日志分析，当天有几十条连不上接口的日志。\r\n\r\n故障时间: 10月13号 0:00 到 10月15号 18:00','68上的tomcat启动内存过低。导致请求处理不过来。造成大量滞留的链接.导致的现象.后面调大内存后,没有再出现类似的现象.','1','已经解决','2016-10-17 14:48:34'),(86,'192.168.241.146 hadoop 用户无法登陆','linqiang',NULL,'铜牛机房',NULL,'高','192.168.241.146 hadoop 用户无法登陆，报错 su: cannot set user id: Resource temporarily unavailable','/etc/security/limits.d/90-nproc.conf   里面的 soft 参数调大.','1','已经解决','2016-10-27 17:19:09'),(87,'192.168.241.49 账族的机器宕机','linqiang',NULL,'铜牛机房',NULL,'高','系统bug故障，192.168.241.49 账族的机器宕机','重启启动，业务恢复','1','已经解决','2016-10-31 09:19:35'),(88,'理财市场haproxy异常,导致无法访问,中断5分钟','wangjunjie',NULL,'铜牛机房',NULL,'普通','故障时间: 2016-10-31 9:56 到 10:05，时长10分钟\r\n故障现象：10.198.2.180 已经ping不通了。业务中断, 故障前last_ack 链接数过多.达到1W多个. 主要是这个原因导致业务中断. 后面自动恢复了.另外,故障发生前,流量有稍微的增大,负责也有上升的趋势.后面因为网络不通了.监控点也无法描述了.\r\n恢复之后,有大的CDN回源现象,CDN的每个节点的连接数最高每个节点有1000多个.应该是之前业务中断导致的请求拥塞,一次性发过来了. 虽然马上恢复.','系统日志暂时没发现什么,只有在恢复后,CDN大量回源的时间,系统日志报possible SYN flooding on port 80. Sending cookies.随后恢复就没有日志了.\r\n目前已处理恢复，问题还得查一下.','5','已经解决','2016-10-31 11:32:59'),(89,'192.168.241.144卡牛社区php-fpm进程达到2万7千多，把内存占满','yangyang',NULL,'铜牛机房',NULL,'高','192.168.241.144 这台机器负载过大，上去查看总内存是190G，几乎占满，top 查看没有进程占的内存比较大 ，查看进程发现php-fpm进程达到2万7千多个占满了内存导致服务器压力过大','/etc/init.d/php-fpm restart\r\n重启php-fpm后，进程还是2万7千多个内存没有释放\r\npkill php-fpm && /etc/init.d/php-fpm start\r\n杀掉php-fpm进程重新启动 刚启动进程是400，内存已经释放，但是php-fpm进程还是不断增加，一个晚上增长到4500，超过了php-fpm的配置最大进程数。\r\n因此怀疑是程序问题，程序在不断的复制进程，向开发反应了问题之后，开发检查新发的版本，注释掉有问题代码，上传到服务器，杀掉php-fpm进程重新启动，进程不在增加，内存占用也比较低了','1','已经解决','2016-10-31 14:29:52'),(90,'大数据主节点 192.168.241.7宕机','linqiang',NULL,'铜牛机房',NULL,'高','大数据主节点 192.168.241.7宕机，查看日志是cpu报错导致','PU报错的原因是由于CPU 节能引起的，关闭cpu节能选项可以解决。 日志看硬件没有告警.','1','已经解决','2016-11-11 09:49:21'),(91,'卡牛宿主机10.192.1.74宕机','linqiang',NULL,'铜牛机房',NULL,'普通','卡牛宿主机10.192.1.74宕机','重启业务恢复','3','已经解决','2016-11-18 15:53:20'),(92,'随手记机房 redis 192.168.241.6 一块硬盘坏掉','linqiang',NULL,'铜牛机房',NULL,'高','随手记机房 redis 192.168.241.6 一块硬盘坏掉','工程师上门更换硬盘','1','已经解决','2016-12-06 17:43:04'),(93,'随手记用户中心库系统宕机','linqiang',NULL,'铜牛机房','/usr/local/tomcat_6.041/upload/2017-04-25/linqiang/64910.txt','高','2017-04-24 早上 随手记用户中心库系统宕机，截图附件','内核bug，先运行观察一段时间','1','已经解决','2017-04-25 15:39:58'),(94,'cardniu.com域名证书CDN节点未更新, 影响信贷业务的使用','wangjunjie',NULL,'铜牛机房',NULL,'普通','故障处理\r\n    09:20 运维同事接到电话, 得知故障情况进行排查.\r\n    09:30 基本断定为域名证书过期导致的问题,准备最新的证书,并确定紧急方案.\r\n    09:40 通知CDN的同事上传更新最新的域名证书,同时进行域名切换回源操作,大概15分钟内全国生效,用户访问逐渐恢复\r\n    09:55 全国绝大部分用户页面已恢复访问,但是后端服务器由于营销活动负载过重,后台服务访问不稳定\r\n    10:15 经过确定,运维对后端服务切换至备用机,业务逐渐恢复.\r\n    10:30 发现域名切换回源之后,服务器流量达到瓶颈,导致用户访问较为缓慢\r\n    10:45 后端服务切换回主服务器,业务访问正常.域名切换到CDN,15分钟全国生效.\r\n    10:55 收到帝联回复证书已更新完成,切换至CDN基本全国生效\r\n\r\n故障原因\r\n    主要原因: 域名SSL证书过期,CDN节点的证书未更新.导致CDN的域名无法提供访问.\r\n    次要原因: 多个业务混合在同一服务器上,导致运营活动带来的服务器压力.影响其他业务.','解决方案\r\n    1.CDN节点https监控缺乏问题.\r\n    解决方案: 跟CDN厂商沟通,能否提供对应的监控报警,及时通知到运维.另一方面,运维部尝试收集部分的CDN节点,部署监控进行实时报警.\r\n    2.DNS域名切换时间过长\r\n    解决方案: 可以购买DNSPOD服务,代替万网域名解析的功能.在域名进行调整的时候能快速生效.减少域名切换带来的故障影响时长.\r\n    3.域名证书相关信息不完整,带来的故障影响\r\n    解决方案: 整理域名信息,包括证书过期时间,证书使用范围等进行汇总.并形成相关域名,域名证书操作的规范化文档.减少人为操作失误或者信息遗漏带来的故障.','1','已经解决','2017-04-26 20:09:17'),(95,'10.192.1.140(卡牛随手借点)','hufangrui',NULL,'铜牛机房',NULL,'高','新初始化的机器，ntp服务器使用外网地址，没有配置dns，导致无法同步时间。。。\r\n\r\n调用db函数，使用错误时间。','DB初始化主机没设置dns配置，导致初始化出的mysql 机器dns被清空','1','已经解决','2017-05-08 15:39:42'),(96,'10.201.3.201 大数据拉数据导致同网段丢包','hufangrui',NULL,'铜牛机房',NULL,'高','10.201.3.201 大数据拉数据导致同网段丢包','业强修改3个大表数据拉取方式为增量拉取。','1','已经解决','2017-05-08 15:53:49'),(97,'192.168.241.45 数据库宕机','osadmin',0,'随手记','/static/event/1496378193_DRVLV[R@E2D)E((G$S1[Y[S.jpg','高','192.168.241.45 数据库宕机，内核报错','','北京铜牛机房','正在解决','2017-05-31 17:40:18'),(98,'随手记日志库241.132宕机','linqiang',0,'随手记','/static/event/1496885092_241.132.jpg','高','2017-06-08-9:00随手记日志库241.132宕机','','北京铜牛机房','正在解决','2017-06-06 17:45:42'),(99,'金融核心DB 10.198.4.162 宕机','linqiang',1,'金融','/static/event/1497324952_10.198.4.162.png','高','故障时间:03:10\r\n响应时间:03:15\r\n解决时间:04:10\r\n\r\n\r\n\r\n临时解决:将写切换到马驹桥从库','','北京铜牛机房','正在解决','2017-06-09 17:50:27'),(100,'10.203.2.20:3307（广告主后台数据库）cpu爆满导致机器短暂无响应','hufangrui',1,'大数据','/static/event/1497957780_2017-6-20 19-20-04.png','普通','cpu爆满导致机器短暂无响应\r\n\r\n期间有出现慢速SQL，已添加了索引，但是无法确定是否解决问题。','','北京马驹桥机房','已经解决','2017-06-14 12:46:07'),(101,'10.255.3.204故障切换导致设置主库为只读','hufangrui',3,'随手记','/static/event/1497958074_Catch9670(06-20-19-14-42).jpg','高','故障切换失败，导致将主库设置为只读','总结：\r\n1、机器重做后，mha检查操作步骤\r\n/data/MYSQL_MHA/MHA_COMMON/mysqlvip_mysqlport_所有MHA更新来源_脚本与配置为最新/add_newMHA4.sh\r\n2、检查bingloserver的binlog文件是否与master是否一致\r\n3、故障切换后，需要与业务人员确认业务是否正常','北京马驹桥机房','已经解决','2017-06-14 12:46:07'),(102,'10.195.1.32 网卡故障','hufangrui',0,'随手记','/static/event/1500272694_Cache_23490c3959e8b115..jpg','高','网卡故障，无法与交换机通讯，更改网卡接口解决','更改网卡接口解决','北京马驹桥机房','已经解决','2017-07-17 13:53:37'),(103,'账族服务器宕机处理(192.168.241.49)','hufangrui',1,'随手记','/static/event/1500535673_Cache_-51b7f617ec317aea..jpg','普通','机器宕机，冷重启恢复','','北京铜牛机房','尚未解决','2017-07-18 18:19:55'),(104,'10.195.1.165  磁盘空间爆满100%','chenping',0,'大数据','/static/event/1509069311_P_AY7I8XY00LNCNN8_`P{{B.jpg','高','2017/10/26   在对10.195.1.165进行tomcat日志进行备份，致使该机器的磁盘空间达到100%，\r\n该机器的总空间为100G，备份之前空间已达到77%，tomcat日志为30G，在对日志tar包后，该主机的\r\n空间就瞬间爆满了，所幸及时对备份的tar进行删除，没有对主机和业务造成影响。','在磁盘空间爆满后，及时对tar包日志进行了删除，该主机磁盘空间恢复正常\r\n','北京马驹桥机房','已经解决','2017-10-24 15:46:59');
